  \"2016-06-01T01:07:27.564243\",\n\t\"name\": \"summer-food-service-program-sfsp-mobile-route-maker\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This tool is primarily a routing tool for
  Summer meal sponsors, vendors and State agencies that is overlaid on the Capacity
  Builder. Routing is especially important for less densely populated areas, such
  as rural areas. This tool will help a variety of audiences allocate resources efficiently
  and in a cost effective way. Sponsors can identify potential summer sites for mobile
  feeding by identifying gaps in service in the neediest areas, plan the most efficient
  monitoring routes, and find routes to local food vendors to create fresh local meals
  (http://www.fns.usda.gov/farmtoschool/farm-summer). In addition self-prep central
  kitchens and vendors can find the best route to deliver meals to each Summer meal
  site. State agencies can also use this tool to plan the most efficient monitoring
  routes throughout the summer.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
